import React from 'react';
import './src//App.css';

const Newsitem = (props) => {

    let {title, description, imgUrl ,newsUrl} = props;
    return (
        <div className="my-2">
        <div className="card" style={{width: "18rem" , margin: "3rem" , height: "15rem"}}>
            <img className="card-img-top" src={imgUrl} alt="..."/>
            <div className="card-body">
                <h5 className="card-title">{title}</h5>
                <p className="card-text">{description}</p>
                <a href={newsUrl} target="_blank" className="btn btn-sm btn-primary" id="readbtn">Read More</a>
            </div>

      </div>
      </div>
    )
  
    }
  
export default Newsitem
